<TABLE width="820" cellpadding="20" cellspacing="6" bgcolor="#e0e0e0">
  <TBODY>
    <TR>
      <TD bgcolor="#ffffff" width="50%" valign="top"><IMG src="http://www.rakuten.ne.jp/gold/worldcycle-wh/safety01.jpg" width="284" height="42" border="0" alt="自転車のルールとマナー"><BR><BR>
      <UL type="square">
        <LI><font size="-2">自転車は<font color="red">左側通行</font>。1列になって走る。併走しない。</LI>
        <LI>自転車通行可能な歩道を通る場合は、<font color="red">歩行者優先で徐行運転</font>。</LI>
        <LI>信号や道路標識に従って走る。</LI>
        <LI><font color="red">交差点では二段階右折</font>。</LI>
        <LI>飲酒運転は絶対にしない。</LI>
      </font></UL>
      </TD>
      <TD bgcolor="#ffffff" width="50%" valign="top"><img src="http://www.rakuten.ne.jp/gold/worldcycle-wh/safety02.jpg" align="right">
      <UL type="square">
        <LI><font size="-2">イヤホンで音楽を聴きながらの運転や、携帯電話を操作しながらの運転、傘をさしながらの運転など<font color="red">「ながら運転」</font>はしない。</LI>
        <LI>安全対策の為、<font color="red">ヘルメットは必ず着用</font>しよう。</LI>
        <LI>薄暗くなってきたら、周りに存在を気づかせるため、ライトを点灯しよう。（トンネル内でも同様）また、後続車に気づかせるため、<font color="red">赤色の尾灯もしくは反射材</font>をつける。</LI>
        <LI><font color="red">スピードは控えめに</font>、レースするなら大会にエントリーして思う存分走ろう。</li>
      </font></UL>
      </TD>
    </TR>
  </TBODY>
</TABLE>
<br>
